/*Table structure for table `client8` */

DROP TABLE IF EXISTS `client8`;

CREATE TABLE `client8` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `enitityId` int(11) NOT NULL DEFAULT '1',
  `clientCode` varchar(15) COLLATE utf8_unicode_ci NOT NULL,
  `clientName` varchar(75) COLLATE utf8_unicode_ci NOT NULL,
  `clientStatus` int(11) NOT NULL,
  `sectorId` int(11) DEFAULT NULL,
  `subSector` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `fsPeriode` char(2) COLLATE utf8_unicode_ci NOT NULL,
  `address` text COLLATE utf8_unicode_ci,
  `cityId` int(11) DEFAULT NULL,
  `provinceId` int(11) DEFAULT NULL,
  `mainProvince` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `mainPostalCode` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `mainPOBox` varchar(15) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'N/A',
  `mainPhone` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'N/A',
  `mainFax` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'N/A',
  `billingAddress` text COLLATE utf8_unicode_ci,
  `billingCityId` int(11) DEFAULT NULL,
  `billingPostalCode` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `billingPOBox` varchar(15) COLLATE utf8_unicode_ci NOT NULL,
  `billingCountry` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `billingCPName` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `billingCPSalutation` int(11) NOT NULL,
  `billingCPPosition` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `billingCPPhone` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `billingCPFax` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `billingCPHandphone` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `billingCPEmail` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `npwpName` varchar(75) COLLATE utf8_unicode_ci NOT NULL,
  `npwpAddress` text COLLATE utf8_unicode_ci,
  `npwp` varchar(25) COLLATE utf8_unicode_ci NOT NULL,
  `ppn` decimal(6,2) NOT NULL,
  `bpkmId` tinyint(4) NOT NULL,
  `listed` tinyint(4) NOT NULL,
  `listedType` int(11) NOT NULL,
  `stockExchange` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `parentCompany` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `parentCountry` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `prevAuditor` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `foreignShareholders` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `multinational` tinyint(2) NOT NULL COMMENT '1. yes, 2.no',
  `clientDeleted` tinyint(4) NOT NULL,
  `userCreate` int(11) NOT NULL DEFAULT '-1',
  `createDate` datetime NOT NULL,
  `userUpdate` int(11) NOT NULL DEFAULT '-1',
  `updateDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=305 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

