/*Table structure for table `clientcontactperson` */

DROP TABLE IF EXISTS `clientcontactperson`;

CREATE TABLE `clientcontactperson` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `entityId` int(11) DEFAULT NULL,
  `clientId` int(11) NOT NULL,
  `clientCode` varchar(15) COLLATE utf8_unicode_ci NOT NULL,
  `contactName` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `salutation` int(11) NOT NULL COMMENT '1. Mr, 2.Mrs, 3.Ms',
  `position` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `handphone` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `emailAddress` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
