/*Table structure for table `employee_status` */

DROP TABLE IF EXISTS `employee_status`;

CREATE TABLE `employee_status` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `employeeStatus` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL,
  `employeeStatusColors` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `employee_status` */

insert  into `employee_status`(`id`,`employeeStatus`,`employeeStatusColors`) values (1,'Internship','btn btn-xs btn-theme-inverse btn-transparent'),(2,'Probation','btn btn-xs btn-warning btn-transparent'),(3,'Contract','btn btn-xs btn-theme btn-transparent'),(4,'Permanent','btn btn-xs btn-info btn-transparent'),(5,'others','');

/*Table structure for table `engagement` */

DROP TABLE IF EXISTS `engagement`;

CREATE TABLE `engagement` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `entityId` int(11) NOT NULL DEFAULT '1',
  `code` varchar(25) COLLATE utf8_unicode_ci NOT NULL,
  `engagementDate` datetime NOT NULL,
  `clientId` int(11) DEFAULT NULL,
  `serviceTitleId` int(11) DEFAULT NULL,
  `yearService` varchar(8) COLLATE utf8_unicode_ci DEFAULT NULL,
  `description` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `partnerId` int(11) DEFAULT NULL,
  `managerId` int(11) DEFAULT NULL,
  `seniorId` int(11) DEFAULT NULL,
  `complexity` tinyint(4) NOT NULL,
  `risk` tinyint(2) NOT NULL,
  `agreedFees` decimal(18,2) NOT NULL,
  `agreedExpenses` decimal(18,2) NOT NULL,
  `estimatedCost` decimal(18,2) NOT NULL,
  `signingPartnerId` int(11) DEFAULT NULL,
  `engagementPartnerId` int(11) DEFAULT NULL,
  `asset` decimal(18,2) NOT NULL,
  `rl` decimal(18,2) NOT NULL,
  `reportNo` varchar(25) COLLATE utf8_unicode_ci NOT NULL,
  `reportDate` datetime NOT NULL,
  `opinion` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `jobFromEmployeeId` int(11) NOT NULL,
  `finishStatusId` tinyint(2) DEFAULT NULL COMMENT '1. Finish, 2. On Progress, 3.cancel',
  `finishDate` datetime NOT NULL,
  `finishApproveBy` int(11) DEFAULT NULL,
  `closing` tinyint(2) NOT NULL,
  `closingDate` datetime NOT NULL,
  `deleted` tinyint(4) NOT NULL,
  `inputby` varchar(15) COLLATE utf8_unicode_ci NOT NULL,
  `version` int(11) NOT NULL,
  `userCreate` int(11) DEFAULT NULL,
  `createDate` datetime NOT NULL,
  `userUpdate` int(11) DEFAULT NULL,
  `updateDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
