/*Table structure for table `engagementdetail` */

DROP TABLE IF EXISTS `engagementdetail`;

CREATE TABLE `engagementdetail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `engagementId` int(11) NOT NULL,
  `employeeId` int(11) DEFAULT NULL,
  `budgetHour` decimal(6,1) NOT NULL,
  `billingRate` decimal(18,2) NOT NULL,
  `costrate` decimal(18,2) NOT NULL,
  `startDate` datetime NOT NULL,
  `endDate` datetime NOT NULL,
  `version` int(11) NOT NULL,
  `approvedBy` int(11) DEFAULT NULL,
  `approvedStatus` tinyint(2) NOT NULL DEFAULT '2' COMMENT '1. Approved, 2. Pending',
  `userUpdate` int(11) DEFAULT NULL,
  `updateDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1463 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

