/*Table structure for table `entity` */

DROP TABLE IF EXISTS `entity`;

CREATE TABLE `entity` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `address` text COLLATE utf8_unicode_ci,
  `phone` double DEFAULT NULL,
  `fax` double DEFAULT NULL,
  `logo` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL,
  `zipcode` double DEFAULT NULL,
  `site` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `npwp` varchar(80) COLLATE utf8_unicode_ci DEFAULT NULL,
  `npwp_date` date DEFAULT NULL,
  `npwp_signing` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `coa_code` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  `userCreate` int(11) NOT NULL DEFAULT '-1',
  `update_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

