/*Table structure for table `expensereimbursementdetail` */

DROP TABLE IF EXISTS `expensereimbursementdetail`;

CREATE TABLE `expensereimbursementdetail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `entityId` int(11) NOT NULL DEFAULT '1',
  `expenseId` int(11) DEFAULT NULL,
  `engagementId` int(11) DEFAULT NULL,
  `employeeId` int(11) DEFAULT NULL,
  `periodeDate` datetime NOT NULL,
  `expenseDate` datetime NOT NULL,
  `amount` decimal(18,2) NOT NULL,
  `description` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `approvalBy` int(11) DEFAULT NULL,
  `approvalStatus` tinyint(2) NOT NULL COMMENT '1. Approved,2.pending',
  `billed` tinyint(4) NOT NULL,
  `billedDate` datetime NOT NULL,
  `userCreate` int(11) DEFAULT NULL,
  `createDate` datetime DEFAULT NULL,
  `userUpdate` int(11) DEFAULT NULL,
  `updateDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=118 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

